import './App.css';
import { ChakraProvider } from '@chakra-ui/react';
import {
  FormControl,
  FormLabel,
  FormErrorMessage,
  FormHelperText,
  Box,
} from '@chakra-ui/react'

function App() {
  return (
    <ChakraProvider>
    <div className="App">
      <h1>Hello</h1>
      <Box>
      <FormControl>
        <FormLabel>Add Sundae</FormLabel>
        <FormHelperText>Here is some other text</FormHelperText>
      </FormControl>
      </Box>
    </div>
    </ChakraProvider>
  );
}

export default App;
